INSERT INTO `bilibili_videos` VALUES (1748870854, 114605850365721, 1, 137, '明星综合', 1, 'http://i2.hdslb.com/bfs/archive/26b1372ea5121b63679602bd19b23aad87627400.jpg', '【沈月】故事的最最最最开始 是一部热血少女漫', 1748748090, 1748748090, '我把开画和快大的收官vlog合并在了一起，总觉得这样能让大家看到一条最完整的时间线。\n还记得最开始做vlog的时候，视频质量真的很粗糙。素材东拼西凑，bgm是剪映上随便套的，自动识别的字幕常常会出现错别字，我都懒得改。后来开始加画外音，没想到半死不活的配音，大家竟然也很喜欢。因为有这份包容我才可以坚持更新下去。再后来，我可以直接跟镜头交流了，视频里的出现的朋友越来越多，人一多，说的话也变多了，不再需要我的画外音讲解了，录画外音的心思就用在了研究bgm，镜头，剪辑，彩蛋上。\n我把vlog形容成薄荷糖，是出于', 0, 595, '娱乐综合', '娱乐', 'https://b23.tv/BV1EX73ztETb', '', 807421, 2607, 1936, 5520, 19641, 899, 0, 0, 38090, 0, 0, 807421, 27, 0, 649831334, '沈月本人', 'https://i2.hdslb.com/bfs/face/605955c5d62abec3ffda45a94cbfe81cc723bc1b.jpg', '开画少女漫,快乐的大人,沈月,Vlog', '2025-06-02 21:27:34');
