INSERT INTO `bilibili_videos` VALUES (1748870854, 114607477752060, 1, 231, '计算机技术', 1, 'http://i0.hdslb.com/bfs/archive/fd411f53e38ca9c64b539a88cbabc721b8cb6b17.jpg', '投诉领导后，我被光速开除~', 1748771900, 1748771900, '最近有不少朋友关注到「我投诉领导后被公司光速开除」的事，我的家人也挺担心我的状态。所以这期视频，我想借这个机会，聊聊整件事情，主要有三个目的：\n第一，让关心我的亲友们了解事情的全貌，放心我现在的状态；\n第二，给还不清楚来龙去脉的朋友，还原一下时间线；\n第三，聊聊我在这件事中的处理方式、心路历程，以及后续的规划。\n这件事在当今这个信息爆炸、舆论汹涌的时代，也许算不上什么\"大瓜”。比这更严重的违法事件才更容易引发关注与讨论。\n但现实是，像我这样\"够不上违法、却让人难以忍受”的问题，或许才是职场中最常见、最普遍', 0, 1438, '职场发展', '知识', 'https://b23.tv/BV1Go7zzbE3k', '', 207865, 955, 1788, 2287, 8783, 1294, 0, 0, 10952, 0, 0, 207865, 0, 0, 325864133, '飞天闪客', 'https://i2.hdslb.com/bfs/face/d64642c27da984831f3511c828fc3858ca441709.jpg', 'PUA,勇气,职场,开除,领导,投诉,做自己,闪客,成长,打工人', '2025-06-02 21:27:34');
