INSERT INTO `bilibili_videos` VALUES (1748870854, 114608333397717, 1, 228, '人文历史', 1, 'http://i1.hdslb.com/bfs/archive/2fc0cbb3613d03b9a90f3c3b9a431ca32a050080.jpg', '文化盛宴！一期253分钟带你看完中国顶级国宝！', 1748786674, 1748786675, '我做up主不到两年，而这一期视频，却用掉了我快一年的时间。\n 我常常会想；我要带给大家什么样的内容？\n 那一定是我所热爱的，同时也是大家共同热爱的——有趣知识。\n 我喜欢看博物馆，但仍旧只是一个爱好者，我想通过这一期视频，让大家对我们中华民族现阶段最重要的一部分文物有一个初步的了解，让大家去到国内任何一个博物馆，都能邂逅一个个熟面孔，并知晓他们的身世与历史意义。\n 最后，感谢这个让知识可以免费无尽传播的时代，我是受益者，也在努力做一个传播者。\n 但我个人能力有限，错漏还望大家共同指正。\n 愿望我们这一代人', 0, 15135, '人文历史', '知识', 'https://b23.tv/BV1EU7rzkEGd', '这4个多小时视频的审核是时间真长阿！！！！终于出来啦呜呜呜呜！同志们，到大家伙三连的冲锋时刻啦！', 453276, 5672, 1683, 41817, 58053, 4914, 0, 80, 48550, 0, 0, 453276, 516, 0, 102584256, '浪花姜', 'https://i0.hdslb.com/bfs/face/ac04da8dd94a0cbee7312a98383a35f77819c899.jpg', '展览,文物,中国,历史,考古,文化,国宝,博物馆入门攻略,博物馆,青铜器', '2025-06-02 21:27:34');
