INSERT INTO `bilibili_videos` VALUES (1748871188, 114596975222326, 1, 239, '家居房产', 1, 'http://i1.hdslb.com/bfs/archive/1faa275241070b4bc24bba83b4f73a14225ef4cf.jpg', '人均住别墅？！在澳洲买房子居然是这种体验？', 1748750400, 1748611811, '澳洲地广人稀，悉尼住房类型中，公寓只占比33% 剩下均为别墅、联排，于是我带着好奇心去拍摄到了3套风格迥异的住宅\n1、粉丝朋友推倒重建的别墅（预计价格450万+澳币）\n2、首次公开拍卖的富人区别墅（2000万澳币 流拍）\n3、2个月前5500万澳币成交的Rosebay海景豪宅\n未来会持续更新这个海外房产系列，感兴趣的朋友们可以持续关注，拍摄不易求个小赞，感谢！', 0, 1462, '买房租房', '家装房产', 'https://b23.tv/BV1HT7pzZEjk', '人均住别墅？！在澳洲买房子居然是这样的体验？ ', 357495, 2059, 698, 2817, 4814, 904, 0, 0, 14214, 0, 0, 357495, 266, 0, 644255470, '杰克小兔', 'https://i1.hdslb.com/bfs/face/013a96a5d1dc54a152e87816776eaf88997ea5e7.jpg', '澳大利亚,别墅,vlog,跟着UP主看世界,澳洲,豪宅,出行,房地产,买房,房子,日本速通攻略', '2025-06-02 21:33:08');
INSERT INTO `bilibili_videos` VALUES (1748871188, 114596991993249, 1, 171, '电子竞技', 1, 'http://i1.hdslb.com/bfs/archive/85e5cd47b52cb44d07f21615971c983ed4762039.jpg', '新刘备VS六神猴子，新版刘备还能零装备打过常规出装的六神猴子吗', 1748611763, 1748611763, '新刘备:\n普攻和一技能可以暴击。\n一技能:变成锁头，猴子无法靠拉扯躲避\n二技能:释放速度更快，普攻刷新技能，追击猴子能力大大提升。\n大招:射程加成，变成六发霰弹，盾破了还能再续，猴子哪怕秒破盾也无法阻止刘备继续续盾了。\n这已经不能说是天克了，可以说完全就是为了打过猴子这个英雄而生的。\n新刘备真的不强，不信你拿猴子我拿刘备咱两单挑一把。\n零装备打过六神猴这一块，新刘备还是稳稳拿下。\n感谢大家关注支持，明天接着来我们的钻耀打国服，感兴趣的各位观众老爷不妨点个关注一起来玩吧。', 0, 261, 'MOBA游戏', '游戏', 'https://b23.tv/BV1HK7pzbEjz', '', 1429073, 1214, 3209, 6244, 1010, 15002, 0, 0, 42879, 0, 0, 1429073, 2380, 0, 485919810, '江东蟹宝王', 'https://i0.hdslb.com/bfs/face/778d3d253071b90f6b118e145e7c4dd04c156032.jpg', '王者荣耀UP主激励计划,刘备,猴子,娱乐,游戏视频,电子竞技,王者荣耀,MOBA,斗蛐蛐,整活', '2025-06-02 21:33:08');
