INSERT INTO `bilibili_videos` VALUES (1748871188, 114602360774500, 1, 228, '人文历史', 1, 'http://i0.hdslb.com/bfs/archive/aa74948481b3375b77dad995bea66daf82f46cf7.jpg', '去乡村小学支教，我给孩子们朗诵《送东阳马生序》', 1748768400, 1748695051, '《送东阳马生序》是明代文学家宋濂创作的一篇赠序。在这篇赠序里，作者叙述个人早年虚心求教和勤苦学习的经历，生动而具体地描述了自己借书求师之难，饥寒奔走之苦，并与太学生优越的条件加以对比，有力地说明学业能否有所成就，主要在于主观努力，不在天资的高下和条件的优劣，以勉励青年人珍惜良好的读书环境，专心治学。全文结构严谨，详略有致，用对比说理，在叙事中穿插细节描绘，读来生动感人。\n同时非常感谢vivo给予本期视频的大力支持。\n vivo童画未来美育计划已经覆盖江西、贵州、甘肃、云南等20多个省（含直辖市）的90多所', 0, 965, '应试教育', '知识', 'https://b23.tv/BV1xK7Pz2Euu', '', 1397621, 2720, 1497, 12631, 23047, 1069, 0, 53, 123268, 0, 0, 1397621, 777, 0, 28626598, '有山先生', 'https://i1.hdslb.com/bfs/face/2991fb4983518ab32f80f9c488d8d3946a93f1a3.jpg', '诗词,教育,bilibili高考季,vivo童画未来美育计划,百大,课文,诸暨,vivo,宋濂,柴西,2025 哔哩哔哩高考', '2025-06-02 21:33:08');
