INSERT INTO `bilibili_videos` VALUES (1748871188, 114605883983220, 1, 24, 'MAD·AMV', 1, 'http://i0.hdslb.com/bfs/archive/f7fb84c5b8a979b99e86412ca1c08a31dc8c33d7.jpg', '【Mygo/Mujica】假如睦和mortis是姐妹', 1748747158, 1748747159, '睦和莫都很可爱，但是双重人格这招太狠了。如果她们各自独立存在会怎么样呢？于是有了这一作。\n经典一个念头越做越长，想塞的饺子醋越来越多，愣是拼好番拼出了一集的时长。其实想作为素世生贺发的，拼尽全力也没能在527做完，肝到昨天才勉强完工。\n可能因为太长了，没多少人愿意看完；可能因为喜剧要素减少了，观感不够有趣。但是，我所理解的，我想看到的，我欲传达的，都在这里了。若能有幸打动到谁的话，也就值得了吧。\n视频最后的话，既是mortis说的，也是我说的。Mujica开播前，我曾深深希望睦能幸福。但事已至此，仅仅祝她', 0, 1204, '同人动画', '二次元', 'https://b23.tv/BV1qd73zxEqL', '', 108103, 1152, 1012, 10377, 10465, 3166, 0, 0, 16332, 0, 0, 108103, 0, 0, 3493080812489335, '对人谈情_', 'https://i1.hdslb.com/bfs/face/792fbfc994fcead7f71d297afc8fee2012f8b76f.jpg', 'mygo,ave mujica,素睦,睦祥,动画种草激励计划,睦莫,bangdream,若叶睦,mujica,六月动画种草激励', '2025-06-02 21:33:08');
